import React from "react";
import { Redirect, Route } from "react-router-dom";
const AppRoutes = ({ component: Component, components, path, ...rest }) => {
  return (
    <Route
      exact
      path={path}
      render={(props) => <Component {...props} />}
      {...rest}
    />
  );
};

export default AppRoutes;
